function ProductsLayout() {
  return (
    <section className="ProductsLayout">
      <h1 className="ProductsLayout-Name">
        Name
        <p className="ProductsLayout-name-item">Item#1</p>
      </h1>
      <h1 className="ProductsLayout-price">
        Price
        <p className="ProductsLayout-price-">100$</p>
      </h1>
      <p>Details Here !!</p>
      <h1>
        Quantity
        <input type="number" placeholder="3"></input>
      </h1>
      <button>Get</button>
    </section>
  );
}
export default ProductsLayout;
